import React, { useEffect, useState } from 'react';
import './style.css';

function Panel(){
    const [medicos, setMedicos] = useState([]); 

    useEffect(() => {
       Listar();
    }, []);

    const Listar = () =>{

        const url = "http://localhost:5000/api/Medico";
        fetch(url,{
            // headers: {
                //   authorization: 'Bearer ' + localStorage.getItem('Real-Vagas-Token')
                //},
                method: 'GET',
            })
            .then((response) => response.json())
            .then((dados) => {
                setMedicos(dados);
                console.log(dados);
            })
            .catch((error) => console.error(error)); 
    };

    return(
    <div>
        <div className="container">
  <ul className="responsive-table">
    <li className="table-header">
      <div className="col col-1">Nome do m√©dico(a)</div>
      <div className="col col-2">CRM</div>
      <div className="col col-3">Ver mais</div>
      <div className="col col-4">Deletar</div>
    </li>
    {
    medicos.map((item:any) =>{

    <li className="table-row">
      <div className="col col-1" data-label="Job Id">{item.nome}</div>
      <div className="col col-2" data-label="Customer Name">John Doe</div>
      <div className="col col-3" data-label="Amount">$350</div>
      <div className="col col-4" data-label="Payment Status">Pending</div>
    </li>
    })
    }
  </ul>
</div>
    </div>
    );
}

export default Panel;
